.patient-card {
  max-width: 400px;

  .mat-card-title {
    margin-bottom: 0;
    display: inline-flex;
    line-height: 1.3;

    .mat-icon {
      margin-right: 5px;
    }
  }

  .mat-card-content {
    display: block;
    margin-bottom: 16px;
    margin-top: 10px;
    border-top: 1px solid lightgray;
    padding-top: 20px;

    .patient-card-label {
      font-weight: bold;
    }

    .patient-card-address {
      margin-bottom: 5px;

      div {
        .street {
          padding: 0 16px 0 0 !important;
        }
      }
    }

    .patient-card-description {
      margin-top: 5px;
    }
  }
}

::ng-deep .mat-card-header-text {
  margin: 0 16px 0 0 !important;
}

